package diffsize

import (
	"runtime"
	"sync"
	"testing"
)

func BenchmarkSyncPool(b *testing.B) {
	b.ReportAllocs()

	limit := make(chan struct{}, 10)
	wg := sync.WaitGroup{}

	for x := 0; x < b.N; x++ {
		b.StopTimer()
		runtime.GC()
		pool := sync.Pool{
			New: func() any {
				return &[]byte{}
			},
		}
		b.StartTimer()

		for _, buffSize := range randSeq {
			buffSize := buffSize

			limit <- struct{}{}
			wg.Add(1)
			go func() {
				defer func() { <-limit }()
				defer wg.Done()

				b := pool.Get().(*[]byte)
				l := len(*b)
				if l < buffSize {
					// This is probably the most efficient way to get to the
					// right buffer size.
					n := make([]byte, buffSize)
					pool.Put(&n)
					if l != 0 {
						// We had a buffer, it was just too small, so put it back in
						// as it could be usable.
						pool.Put(b)
					}
				}
			}()
		}
		wg.Wait()
	}
}

func BenchmarkPool(b *testing.B) {
	b.ReportAllocs()

	limit := make(chan struct{}, 10)
	wg := sync.WaitGroup{}

	pool, err := New[*[]byte](
		Sizes{
			Size{Size: 8, ConstBuff: 10, SyncPool: true},
			Size{Size: 16, ConstBuff: 10, SyncPool: true},
			Size{Size: 32, ConstBuff: 10, SyncPool: true},
			Size{Size: 64, ConstBuff: 10, SyncPool: true},
			Size{Size: 128, ConstBuff: 10, SyncPool: true},
			Size{Size: 512, ConstBuff: 10, SyncPool: true},
			Size{Size: 1024, ConstBuff: 10, SyncPool: true},
		},
	)
	if err != nil {
		panic(err)
	}

	for x := 0; x < b.N; x++ {
		b.StopTimer()
		runtime.GC()
		b.StartTimer()

		for _, buffSize := range randSeq {
			buffSize := buffSize

			limit <- struct{}{}
			wg.Add(1)
			go func() {
				defer func() { <-limit }()
				defer wg.Done()

				b := pool.Get(buffSize)
				defer b.Close()
				*b.Buffer = (*b.Buffer)[:cap(*b.Buffer)]
			}()
		}
		wg.Wait()
	}
}

